import './App.css';
import { BrowserRouter as Router, Routes,Route} from 'react-router-dom';

import Header from './components/Header/Header'; //Header 컴포넌트 임포트
import LeftArea from './components/Header/Contents/LeftArea/LeftArea'; //LeftArea 컴포넌트 임포트
import Rule from './components/Header/Contents/Rule/Rule';
function App() { 
  return (
    <BrowserRouter>
          <Router>
        <Routes>
          <Route path="/" element={<Header />}/>
          <Route path="/LeftArea" element={<LeftArea/>} />
          <Route path="/Rule" element={<Rule />}/>
        </Routes>
      </Router>
    </BrowserRouter>


  );
}

export default App;
